import React from "react";
import App from "./App";
import { Route } from "react-router-dom";
import WheelPage from "./Components/WheelPage";

function RouteApp() {
  return (
    <div>
      <App />
      <Route path="/try-your-luck" exact>
        <WheelPage />
      </Route>
    </div>
  );
}

export default RouteApp;
